DROP TABLE IF EXISTS `user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `user` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户id 自增',
  `username` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户帐号',
  `phone` char(15) COLLATE utf8_unicode_ci NOT NULL COMMENT '手机',
  `roler` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '用户角色:0会员 9管理员',
  `uuid` varchar(64) COLLATE utf8_unicode_ci NOT NULL,
  `password` char(60) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户密码',
  `realname` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '真实姓名',
  `sex` enum('man','woman','secret') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'secret' COMMENT '性别: man, woman, secret',
  `birthday` varchar(10) COLLATE utf8_unicode_ci NOT NULL COMMENT '生日',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '邮箱',
  `id_card` char(18) COLLATE utf8_unicode_ci NOT NULL COMMENT '身份证号',
  `avatar` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT '头像',
  `prov_code` mediumint(8) unsigned NOT NULL COMMENT '省编码',
  `city_code` mediumint(8) unsigned NOT NULL COMMENT '市编码',
  `city_name` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '城市名称',
  `reg_time` int(10) unsigned NOT NULL COMMENT '注册时间',
  `last_login_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '上次登录时间',
  `is_forbid` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否禁用 0-未禁用 1-已禁用',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除 0-未删除 1-已删除',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `phone` (`phone`),
  KEY `uuid` (`uuid`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='用户表';
